import Blur from './img/blur.png';

const LandingBox = () => {
    return (
        <div className="w-auto h-auto bg-white rounded-2xl mx-4 my-4 drop-shadow-sm flex items-center justify-between">
            <img className="select-none w-10/12 h-[85vh] my-2 mx-auto blur-3xl scale-y-75 opacity-50" src={Blur} alt="Decoration image" />
            <span className='absolute text-7xl font-bold mx-auto'>Zbudujemy twoją wymarzoną aplikację</span>
        </div>
    )
}

export default LandingBox
